const Carousel = () => {
  return (
    <>
      <Carousel autoplay>
        <div>
          <h3 style={contentStyle}>1</h3>
        </div>
      </Carousel>
    </>
  );
};
Carousel.getInitialProps = async () => {
  let jmb = await Axios.get(api + "image-management/images");

  jmb = jmb.data.data;

  return {
    jmb: jmb,
  };
};
export default Carousel;
